ithout having to know every possible value of\r\nifMauType.  This was felt to be sufficiently\r\nvaluable to justify the redundancy.\r\nReference: [IEEE 802.3 Std.], 30.3.1.1.32,aDuplexStatus.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27462,3,'','',10221,'ICMP ping','icmpping','1m','1w','365d',0,3,'','','',0,'','','','',27149,1,'','',0,'','','','',0,NULL,'','',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27463,3,'','',10221,'ICMP loss','icmppingloss','1m','1w','365d',0,0,'','%','',0,'','','','',27150,NULL,'','',0,'','','','',0,NULL,'','',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27464,3,'','',10221,'ICMP response time','icmppingsec','1m','1w','365d',0,0,'','s','',0,'','','','',27151,NULL,'','',0,'','','','',0,NULL,'','',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27465,17,'','',10221,'SNMP traps (fallback)','snmptrap.fallback','1m','2w','0',0,2,'','','',0,'','','','hh:mm:sszyyyy/MM/dd',27157,NULL,'','',0,'','','','',0,NULL,'','Item is used to collect all SNMP traps unmatched by other snmptrap items',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27469,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.5.0',10221,'System name','system.name','1h','2w','0',0,1,'','','',0,'','','','',27152,NULL,'','',0,'','','','',0,NULL,'','MIB: SNMPv2-MIB\r\nAn administratively-assigned name for this managed node.By convention, this is the node\'s fully-qualified domain name.  If the name is unknown, the value is the zero-length string.',3,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27472,5,'','',10221,'SNMP agent availability','zabbix[host,snmp,available]','1m','7d','365d',0,3,'','','',0,'','','','',27154,22,'','',0,'','','','',0,NULL,'','',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27473,4,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.4.1.6027.3.10.1.2.9.1.