or character-oriented or fixed-length interfaces, the number of inbound transmission units that contained errors preventing them from being deliverable to a higher-layer protocol. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27875,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.6.{#SNMPINDEX}',10233,'Interface {#IFNAME}({#IFALIAS}): Bits received','net.if.in[ifHCInOctets.{#SNMPINDEX}]','3m','7d','365d',0,3,'','bps','',0,'','','','',27104,NULL,'','',0,'','','','',2,NULL,'','MIB: IF-MIB\r\nThe total number of octets received on the interface, including framing characters. This object is a 64-bit version of ifInOctets. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27876,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.19.{#SNMPINDEX}',10233,'Interface {#IFNAME}({#IFALIAS}): Outbound packets discarded','net.if.out.discards[ifOutDiscards.{#SNMPINDEX}]','3m','7d','365d',0,3,'','','',0,'','','','',27102,NULL,'','',0,'','','','',2,NULL,'','MIB: IF-MIB\r\nThe number of outbound packets which were chosen to be discarded\r\neven though no errors had been detected to prevent their being deliverable to a higher-layer protocol.\r\nOne possible reason for discarding such a packet could be to free up buffer space.\r\nDiscontinuities in the value of this counter can occur at re-initialization of the management system,\r\nand at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27877,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.20.{#SNMPINDEX}',10233,'Interface {#IFNAME}({#IFALIAS}): Outbound packets with errors','net.if.out.errors[ifOutErrors.{#SNMPINDEX}]','3m','7d','365d',0,3,'','','',0,'','','','',27103,NULL,'','',0,'','','','',2,NULL,'','MIB: IF-MIB\r\nFor packet-oriented interfaces, the number of outbound packets that contained errors preventing them from being deliverable to a higher-layer protocol.  For character-oriented or fixed-length interfaces, the number of outbound transmission units that contained errors preventing them from being deliverable to a higher-layer protocol. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27878,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.10.{#SNMPINDEX}',10233,'Interface {#IFNAME}({#IFALIAS}): Bits sent','net.if.out[ifHCOutOctets.{#SNMPINDEX}]','3m','7d','365d',0,3,'','bps','',0,'','','','',27105,NULL,'','',0,'','','','',2,NULL,'','MIB: IF-MIB\r\nThe total number of octets transmitted out of the interface, including framing characters. This object is a 64-bit version of ifOutOctets.Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27879,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.15.{#SNMPINDEX}',10233,'Interface {#IFNAME}({#IFALIAS}): Speed','net.if.speed[ifHighSpeed.{#SNMPINDEX}]','5m','7d','0d',0,3,'','bps','',0,'','','','',27101,NULL,'','',0,'','','','',2,NULL,'','MIB: IF-MIB\r\nAn estimate of the interface\'s current bandwidth in units of 1,000,000 bits per second. If this object reports a value of `n\' then the speed of the interface is somewhere in the range of `n-500,000\' to`n+499,999\'.  For interfaces which do not vary in bandwidth or for those where no accurate estimation can be made, 