ce: [IEEE 802.3 Std.], 30.3.1.1.32,aDuplexStatus.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28957,3,'','',10248,'ICMP ping','icmpping','1m','1w','365d',0,3,'','','',0,'','','','',27149,1,'','',0,'','','','',0,NULL,'','',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28958,3,'','',10248,'ICMP loss','icmppingloss','1m','1w','365d',0,0,'','%','',0,'','','','',27150,NULL,'','',0,'','','','',0,NULL,'','',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28959,3,'','',10248,'ICMP response time','icmppingsec','1m','1w','365d',0,0,'','s','',0,'','','','',27151,NULL,'','',0,'','','','',0,NULL,'','',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28960,17,'','',10248,'SNMP traps (fallback)','snmptrap.fallback','1m','2w','0',0,2,'','','',0,'','','','hh:mm:sszyyyy/MM/dd',27157,NULL,'','',0,'','','','',0,NULL,'','Item is used to collect all SNMP traps unmatched by other snmptrap items',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28964,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.5.0',10248,'System name','system.name','1h','2w','0',0,1,'','','',0,'','','','',27152,NULL,'','',0,'','','','',0,NULL,'','MIB: SNMPv2-MIB\r\nAn administratively-assigned name for this managed node.By convention, this is the node\'s fully-qualified domain name.  If the name is unknown, the value is the zero-length string.',3,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28967,5,'','',10248,'SNMP agent availability','zabbix[host,snmp,available]','1m','7d','365d',0,3,'','','',0,'','','','',27154,22,'','',0,'','','','',0,NULL,'','',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28968,4,'{$SNMP_COMMUNITY}','discovery[{#IFOPERSTATUS},1.3.6.1.2.1.2.2.1.8,{#IFADMINSTATUS},1.3.6.1.2.1.2.2.1.7,{#IFALIAS},1.3.6.1.2.1.31.1.1.1.18,{#IFNAME},1.3.6.1.2.1.31.1.1.1.1,{#IFDESCR},1.3.6.1.2.1.2.2.1.2,{#IFTYPE},1.3.