te of the interface.\r\n- The testing(3) state indicates that no operational packet scan be passed\r\n- If ifAdminStatus is down(2) then ifOperStatus should be down(2)\r\n- If ifAdminStatus is changed to up(1) then ifOperStatus should change to up(1) if the interface is ready to transmit and receive network traffic\r\n- It should change todormant(5) if the interface is waiting for external actions (such as a serial line waiting for an incoming connection)\r\n- It should remain in the down(2) state if and only if there is a fault that prevents it from going to the up(1) state\r\n- It should remain in the notPresent(6) state if the interface has missing(typically, hardware) components.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28977,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.3.{#SNMPINDEX}',10248,'Interface {#IFNAME}({#IFALIAS}): Interface type','net.if.type[ifType.{#SNMPINDEX}]','1h','7d','0d',0,3,'','','',0,'','','','',27100,21,'','',0,'','','','',2,NULL,'','MIB: IF-MIB\r\nThe type of interface.\r\nAdditional values for ifType are assigned by the Internet Assigned NumbersAuthority (IANA),\r\nthrough updating the syntax of the IANAifType textual convention.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28978,15,'','',10268,'Memory utilization','vm.memory.util[snmp]','1m','7d','365d',0,0,'','%','',0,'','','','',NULL,NULL,'(last(\"vm.memory.total[memTotalReal.0]\")-(last(\"vm.memory.free[memAvailReal.0]\")+last(\"vm.memory.buffers[memBuffer.0]\")+last(\"vm.memory.cached[memCached.0]\")))/last(\"vm.memory.total[memTotalReal.0]\")*100','',0,'','','','',0,NULL,'','Please note that memory utilization is a rough estimate, since memory available is calculated as free+buffers+cached, which is not 100% accurate, but the best we can get using SNMP.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28979,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.2021.4.6.0',10268,'Free memory','vm.memory.fr