es, divided by the duration of the sample interval.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(29564,7,'','',10293,'CPU privileged time','perf_counter_en[\"\\Processor Information(_total)\\% Privileged Time\"]','1m','7d','365d',0,0,'','%','',0,'','','','',NULL,NULL,'','',0,'','','','',0,NULL,'','The Processor Information\\% Privileged Time counter shows the percent of time that the processor is spent \r\nexecuting in Kernel (or Privileged) mode. Privileged mode includes services interrupts inside Interrupt \r\nService Routines (ISRs), executing Deferred Procedure Calls (DPCs), Device Driver calls and other kernel-mode \r\nfunctions of the Windows Operating System.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(29565,7,'','',10293,'CPU user time','perf_counter_en[\"\\Processor Information(_total)\\% User Time\"]','1m','7d','365d',0,0,'','%','',0,'','','','',NULL,NULL,'','',0,'','','','',0,NULL,'','The Processor Information\\% User Time counter shows the percent of time that the processor(s) is spent executing \r\nin User mode.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(29566,7,'','',10293,'CPU queue length','perf_counter_en[\"\\System\\Processor Queue Length\"]','1m','7d','365d',0,0,'','','',0,'','','','',NULL,NULL,'','',0,'','','','',0,NULL,'','The Processor Queue Length shows the number of threads that are observed as delayed in the processor Ready Queue \r\nand are waiting to be executed.',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(29567,7,'','',10294,'Used memory','vm.memory.size[used]','1m','7d','365d',0,3,'','B','',0,'','','','',NULL,NULL,'','',0,'','','','',0,NULL,'','Used memory in Bytes',0,'30d',0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(29568,7,'','',10294,'Total memory','vm.memory.size[total]','1m','7d','365d',0,3,'','B','',0,'','','','',NULL,NULL,'','',0,'','','','',0,NULL,'','Total memory in