INSERT INTO `media_type` VALUES (1,0,'Email','mail.example.com','example.com','zabbix@example.com','','','','',0,25,0,0,0,0,'',1,3,'10s',0,'','30s',0,0,'','',''),(3,2,'SMS','','','','','/dev/ttyS0','','',0,25,0,0,0,0,'',1,3,'10s',1,'','30s',0,0,'','',''),(4,4,'Mattermost','','','','','','','',0,25,0,0,0,0,'',1,1,'10s',1,'var SEVERITY_COLORS = [\r\n    \'#97AAB3\', \'#7499FF\', \'#FFC859\',\r\n    \'#FFA059\', \'#E97659\', \'#E45959\'\r\n    ];\r\n\r\nvar RESOLVE_COLOR = \'#009900\';\r\n\r\nvar SEND_MODE_HANDLERS = {\r\n    alarm: handlerAlarm,\r\n    event: handlerEvent\r\n};\r\n\r\nvar EVENT_STATUS = {\r\n    PROBLEM: \'PROBLEM\',\r\n    UPDATE: \'UPDATE\',\r\n    RESOLVE: \'OK\'\r\n}\r\n\r\nif (!String.prototype.format) {\r\n    String.prototype.format = function() {\r\n        var args = arguments;\r\n        return this.replace(/{(\\d+)}/g, function(match, number) { \r\n            return number in args\r\n                ? args[number]\r\n                : match\r\n            ;\r\n        });\r\n    };\r\n}\r\n\r\nfunction isEventProblem(params) {\r\n    return params.event_value == 1\r\n        && params.event_update_status == 0\r\n        ;\r\n}\r\n\r\nfunction isEventUpdate(params) {\r\n    return params.event_value == 1\r\n        && params.event_update_status == 1\r\n        ;\r\n}\r\n\r\nfunction isEventResolve(params) {\r\n    return params.event_value == 0;\r\n}\r\n\r\nfunction getPermalink(mattermostURL, teamName, postID) {\r\n    return \'{0}/{1}/pl/{2}\'.format(\r\n        mattermostURL.replace(/\\/+$/, \'\'),\r\n        teamName,\r\n        postID\r\n        );\r\n}\r\n\r\nfunction getChannel(sendTo) {\r\n    switch (true) {\r\n        case /.+\\/#.+/.test(sendTo):\r\n            return getChannelByName(sendTo);\r\n\r\n        case /@.+/.test(sendTo):\r\n            return getDirectChannel(sendTo);\r\n\r\n        default:\r\n            return getChannelByID(sendTo);\r\n    }\r\n}\r\n\r\nfunction getChannelByName(sendTo) {\r\n    var teamChan = sendTo.trim().split(\'/#\');\r\n\r\n    var resp = JSON.parse(req.Get(\r\n        Mattermost.channelByName.format(teamChan[0], teamChan[1]),\r\n        JSON.stringify(fields)\r\n        )\r\n    );\r\n\r\n    if (req.Status() != 200) {\r\n        throw \'[{0}] {1}\'.format(resp.status_code, resp.message);\r\n    }\r\n\r\n    return resp;\r\n}\r\n\r\nfunction getDirectChannel(sendTo) {\r\n    Zabbix.Log(5, \'[ Webhook ] Call {0}({1})\'.format(\r\n        arguments.callee.name,\r\n        JSON.stringify(arguments)\r\n        ));\r\n\r\n    var teamUser = sendTo.trim().split(\'/@\');\r\n    var bot = getBotUser();\r\n    var user = getUserByName(teamUser[1])\r\n\r\n    var resp = JSON.parse(req.Post(\r\n        Mattermost.directChannel,\r\n        JSON.stringify([bot.id, user.id])\r\n        )\r\n    );\r\n\r\n    Zabbix.Log(5, \'[ Webhook ] Result {0}: {1}\'.format(\r\n        arguments.callee.name,\r\n        JSON.stringify(resp)\r\n        ));\r\n\r\n    if (req.Status() != 201) {\r\n        throw \'[{0}] {1}\'.format(resp.status_code, resp.message);\r\n    }\r\n\r\n    resp.teamName = teamUser[0];\r\n    return resp;\r\n}\r\n\r\nfunction getChannelByID(channelID) {\r\n    Zabbix.Log(5, \'[ Webhook ] Call {0}({1})\'.format(\r\n        arguments.callee.name,\r\n        JSON.stringify(arguments)\r\n        ));\r\n\r\n    var resp = JSON.parse(req.Get(\r\n        Mattermost.getChannel.format(channelID),\r\n        JSON.stringify(fields)\r\n        )\r\n    );\r\n\r\n    Zabbix.Log(5, \'[ Webhook ] Result {0}: {1}\'.format(\r\n        arguments.callee.name,\r\n        JSON.stringify(resp)\r\n        ));\r\n\r\n    if (req.Status() != 200) {\r\n        throw \'[{0}] {1}\'.format(resp.status_code, resp.message);\r\n    }\r\n\r\n    return resp;\r\n}\r\n\r\nfunction getBotUser() {\r\n    Zabbix.Log(5, \'[ Webhook ] Call {0}({1})\'.format(\r\n        arguments.callee.name,\r\n        JSON.stringify(arguments)\r\n        ));\r\n\r\n    var resp = JSON.parse(req.Get(\r\n        Mattermost.botUser,\r\n        JSON.stringify(fields)\r\n        )\r\n    );\r\n\r\n    Zabbix.Log(5, \'[ Webhook ] Result {0}: {1}\'.format(\r\n        arguments.callee.name,\r\n        JSON.stringify(resp)\r\n        ));\r\n\r\n    if (req.Status() != 200) {\r\n        throw \'[{0}] {1}\'.format(resp.status_code, resp.message);\r\n    }\r\n\r\n    return resp;\r\n}\r\n\r\nfunction getUserByName(userName) {\r\n    Zabbix.Log(5, \'[ Webhook ] Call {0}({1})\'.format(\r\n        arguments.callee.name,\r\n        JSON.stringify(arguments)\r\n        ));\r\n\r\n    var resp = JSON.parse(req.Get(\r\n        Mattermost.userByName.format(userName),\r\n        JSON.stringify(fields)\r\n        )\r\n    );\r\n\r\n    Zabbix.Log(5, \'[ Webhook ] Result {0}: {1}\'.format(\r\n        arguments.callee.name,\r\n        JSON.stringify(resp)\r\n        ));\r\n\r\n    if (req.Status() != 200) {\r\n        throw \'[{0}] {1}\'.format(resp.status_code, resp.message);\r\n    }\r\n\r\n    return resp;\r\n}\r\n\r\nfunction getTeamByID(teamID) {\r\n    Zabbix.Log(5, \'[ Webhook ] Call {0}({1})\'.format(\r\n        arguments.callee.name,\r\n        JSON.stringify(arguments)\r\n        ));\r\n\r\n    var resp = JSON.parse(req.Get(\r\n        Mattermost.getTeam.format(teamID),\r\n        JSON.stringify(fields)\r\n        )\r\n    );\r\n\r\n    Zabbix.Log(5, \'[ Webhook ] Result {0}: {1}\'.format(\r\n        arguments.callee.name,\r\n        JSON.stringify(resp)\r\n        ));\r\n\r\n    if (req.Status() != 200) {\r\n        throw \'[{0}] {1}\'.format(resp.status_code, resp.message);\r\n    }\r\n\r\n    return resp;\r\n}\r\n\r\nfunction createProblemURL(zabbixURL, triggerId, eventId) {\r\n    var problemURL = \'{0}/tr_events.php?triggerid={1}&eventid={2}\'\r\n        .format(\r\n            zabbixURL,\r\n            triggerId,\r\n            eventId\r\n        );\r\n\r\n    return problemURL\r\n}\r\n\r\nfunction getTagValue(eventTags, key) {\r\n    var pattern = new RegExp(\'(\' + key + \':.+)\');\r\n    var tagValue = eventTags\r\n        .split(\',\')\r\n        .filter(function (v) {return v.match(pattern)})\r\n        .map(function (v) {return v.split(\':\')[1]})[0]\r\n        || 0;\r\n\r\n    return tagValue;\r\n}\r\n\r\nfunction handlerAlarm(req, params) {\r\n    var channel = getChannel(params.send_to);\r\n    var fields = {\r\n        channel_id: channel.id,\r\n        props: {}\r\n    }\r\n\r\n    if (isEventProblem(params)) {\r\n        var teamName = channel.teamName\r\n            ? channel.teamName\r\n            : getTeamByID(channel.team_id).name\r\n\r\n        fields.props.attachments = [\r\n            createMessage(\r\n                EVENT_STATUS.PROBLEM,\r\n                SEVERITY_COLORS[params.event_nseverity] || 0,\r\n                params.event_date,\r\n                params.event_time,\r\n                createProblemURL(params.zabbix_url, params.trigger_id, params.event_id)\r\n                )\r\n            ];\r\n\r\n        var resp = JSON.parse(req.Post(\r\n            Mattermost.postMessage,\r\n            JSON.stringify(fields)\r\n            )\r\n        );\r\n\r\n        if (req.Status() != 201) {\r\n            throw \'[{0}] {1}\'.format(resp.status_code, resp.message);\r\n        }\r\n\r\n        result.tags.__mattermost_post_id = resp.id;\r\n        result.tags.__mattermost_channel_id = channel.id;\r\n        result.tags.__mattermost_channel_name = channel.name;\r\n        result.tags.__mattermost_message_link = getPermalink(\r\n            params.mattermost_url,\r\n            teamName,\r\n            resp.id\r\n            );\r\n\r\n    } else if (isEventUpdate(params)) {\r\n        fields.root_id = getTagValue(params.event_tags, \'mattermost_post_id\');\r\n        fields.message = params.event_update_message || \'\';\r\n        fields.props.attachments = [\r\n            createMessage(\r\n                EVENT_STATUS.UPDATE,\r\n                SEVERITY_COLORS[params.event_nseverity] || 0,\r\n                param